import React, {useState, useEffect} from 'react'
import {
    StyleSheet,
    Text,
    View,
    Image,
    TextInput,
    Button,
    TouchableOpacity,
  } from "react-native";

import axios from 'axios';

const api_url = "http://parkly-env.eba-u2qumtf7.us-east-2.elasticbeanstalk.com";

export default function detailsPage({navigation, route}) {

    const data = route.params;

    return (
        <View style={styles.container} contentContainerStyle={{alignItems: "center"}}>
            <Text style={styles.titleBar}> Address </Text>
            <Text style={styles.titleBar}> {data.name}</Text>
        </View>
    )

}

const styles = StyleSheet.create({
    
    container: {
        flex: 1,
        backgroundColor: "#fff",
    },

    titleBar: {
        height: 50,
        flex: 1,
        padding: 10,
        marginLeft: 10,
        opacity: 0.6,
    },
});
